import React from 'react'

const aprovados = ['Renato', 'Julia', 'Maria', 'Judite']

export default props => {
    const gerarItens = itens => {
        return itens.map(item => <li>{item}</li>)
    }
    return (
        <ul>
            {gerarItens(aprovados)}
        </ul>
    )
}
